import React, { useState } from 'react';

const CheckoutForm = () => {
    const [step, setStep] = useState(1);
    const [delivery, setDelivery] = useState({
        address: '',
        city: '',
        state: '',
        zip: ''
    });
    const [payment, setPayment] = useState({
        firstName: '',
        lastName: '',
        email: '',
        nameOnCard: '',
        creditCardNumber: '',
        expMonth: '',
        expYear: '',
        cvv: ''
    });

    const handleDeliveryChange = (e) => {
        setDelivery({ ...delivery, [e.target.name]: e.target.value });
    };

    const handlePaymentChange = (e) => {
        setPayment({ ...payment, [e.target.name]: e.target.value });
    };

    const handleNext = () => {
        setStep(step + 1);
    };

    const handleBack = () => {
        setStep(step - 1);
    };

    const handlePlaceOrder = () => {
        alert('Thank you for your purchase!');
    };

    return (
        <div>
            <Stepper activeStep={step - 1} orientation="horizontal">
                <Step>
                    <StepLabel>Delivery</StepLabel>
                </Step>
                <Step>
                    <StepLabel>Payment</StepLabel>
                </Step>
                <Step>
                    <StepLabel>Confirm Order</StepLabel>
                </Step>
            </Stepper>
            {step === 1 && (
                <div>
                    <h2>Delivery</h2>
                    <label>
                        Address:
                        <input
                            type="text"
                            name="address"
                            value={delivery.address}
                            onChange={handleDeliveryChange}
                        />
                    </label>
                    <br />
                    <label>
                        City:
                        <input
                            type="text"
                            name="city"
                            value={delivery.city}
                            onChange={handleDeliveryChange}
                        />
                    </label>
                    <br />
                    <label>
                        State:
                        <input
                            type="text"
                            name="state"
                            value={delivery.state}
                            onChange={handleDeliveryChange}
                        />
                    </label>
                    <br />
                    <label>
                        Zip:
                        <input
                            type="text"
                            name="zip"
                            value={delivery.zip}
                            onChange={handleDeliveryChange}
                        />
                    </label>
                    <br />
                    <button onClick={handleBack}>Back</button>
                    <button onClick={handleNext}>Next</button>
                </div>
            )}
            {step === 2 && (
                <div>
                    <h2>Payment</h2>
                    <label>
                        First Name:
                        <input
                            type="text"
                            name="firstName"
                            value={payment.firstName}
                            onChange={handlePaymentChange}
                        />
                    </label>
                    <br />
                    <label>
                        Last Name:
                        <input type="text"
                            name="lastName"
                            value={payment.lastName}
                            onChange={handlePaymentChange}
                        />
                    </label>
                    <br />
                    <label>
                        Email:
                        <input
                            type="email"
                            name="email"
                            value={payment.email}
                            onChange={handlePaymentChange}
                        />
                    </label>
                    <br />
                    <label>
                        Name on Card:
                        <input
                            type="text"
                            name="nameOnCard"
                            value={payment.nameOnCard}
                            onChange={handlePaymentChange}
                        />
                    </label>
                    <br />
                    <label>
                        Credit Card Number:
                        <input
                            type="text"
                            name="creditCardNumber"
                            value={payment.creditCardNumber}
                            onChange={handlePaymentChange}
                        />
                    </label>
                    <br />
                    <label>
                        Exp Month:
                        <input
                            type="text"
                            name="expMonth"
                            value={payment.expMonth}
                            onChange={handlePaymentChange}
                        />
                    </label>
                    <br />
                    <label>
                        Exp Year:
                        <input
                            type="text"
                            name="expYear"
                            value={payment.expYear}
                            onChange={handlePaymentChange}
                        />
                    </label>
                    <br />
                    <label>
                        CVV:
                        <input
                            type="text"
                            name="cvv"
                            value={payment.cvv}
                            onChange={handlePaymentChange}
                        />
                    </label>
                    <br />
                    <button onClick={handleBack}>Back</button>
                    <button onClick={handleNext}>Next</button>
                </div>
            )}
            {step === 3 && (
                <div>
                    <h2>Confirm Order</h2>
                    {/* Display list of products here */}
                    <button onClick={handleBack}>Back</button>
                    <button onClick={handlePlaceOrder}>Place Order</button>
                </div>
            )}
        </div>
    );
};

export default CheckoutForm;
